import React, {Component} from 'react';
import NavBarButton from './NavBarButton'




class NavBar extends Component {
    render () {

        return (
            <div className="jumbotron navbar navbar-expand-lg bg-light" 
                 style={{background: 'url(https://ru.best-wallpaper.net/wallpaper/1920x1200/1801/Lot-of-dogs-sit-in-a-line_1920x1200.jpg) no-repeat 0 50%'}}>

                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">
                        <NavBarButton name="Dogs List" />
                        <NavBarButton name="Current Dog" />
                    </ul>
                </div>
            </div>
            )
    }
}

export default NavBar;
